def isAnagram(s, t):
    s_length=len(s)
    t_length=len(t)
    if s_length == t_length and s != t:
        a = list(set(s))
        a.sort(key=s.index)
        for j in a:
            if t.count(j) == s.count(j):
                for str_sig in s:
                    if str_sig in t:
                        continue
                    else:
                        return False
                return True
            return False
    if s == t:
        return True
    return False


if __name__ == '__main__':
    print(isAnagram(s="anagram", t="nagaram"))
    print(isAnagram(s="rat", t="car"))
    print(isAnagram(s="", t=""))
    print(isAnagram(s="aacc", t="ccac"))
    a = ""
    b = ""
    print(isAnagram(s=a, t=b))
